oxy_webhelp_navlinks = {"sec_new_device_login_notification-d22908e10904":{"topics":[{"title":"Editing a device name","shortdesc":"<p class=\"shortdesc\">You can edit the name of a device that you used to log in to <span class=\"ph\">RSC<\/span> from         the User Preferences page. Providing a unique name to a device improves device         identification and helps you distinguish between different devices accessing your <span class=\"ph\">RSC<\/span> account.<\/p>","href":"saas\/common\/sec_editing_device_name.html","attributes":{"data-id":"sec_editing_device_name"},"menu":{"hasChildren":false},"tocID":"sec_editing_device_name-d22908e10920","topics":[]},{"title":"Removing a device","shortdesc":"<p class=\"shortdesc\">You can remove a device from the My Devices page in <span class=\"ph\">RSC<\/span> to get         notified whenever RSC detects a login from that device.<\/p>","href":"saas\/common\/sec_removing_device.html","attributes":{"data-id":"sec_removing_device"},"menu":{"hasChildren":false},"tocID":"sec_removing_device-d22908e10937","topics":[]}]}};